import React, { Component } from "react";
import PropTypes from "prop-types";
//import Show from "./layout/Show";

class Img extends Component {
  render() {
    const images = this.props.images;
    {
      images.map((val) => {
        console.log("Entered");
        // Return the element.
        return (
          <div>
            <img
              src={this.props.getImageUrl(
                val.farm,
                val.server,
                val.id,
                val.secret
              )}
              alt="flickr-img"
            />
          </div>
        );
      });
    }
  }
}
//PropTypes
Img.propTypes = {
  getImageUrl: PropTypes.func.isRequired,
  images: PropTypes.array,
};
//<img src={url} alt="flickr-img" />
//this.props.getImageUrl(val.farm, val.server, val.id, val.secret)
export default Img;
